import React from "react";

const ListGroup = () =>{
    return (
        <>
         <div className='list-section mt-4'>
            <div className='card'>
                  <div className='card-body'>
                    <ul classNam="list-group">
                      <li classNam="list-group-item my-1">An item</li>
                      <li classNam="list-group-item my-1">A second item</li>
                      <li classNam="list-group-item my-1">A third item</li>
                      <li classNam="list-group-item my-1">A fourth item</li>
            
                    </ul>
                </div>
              </div>
            
          </div>
        </>
    );
}

export default ListGroup;
